import React from 'react';
import Header from './components/Header';
import Balloons from './components/Balloons';
import MainContent from './components/MainContent';
import Flower from './components/Flower';
import SnowEffect from './components/SnowEffect';
import FriendshipPage from "./FriendshipPage";

function App() {
  return (
    <div>
      <Header />
      <Balloons />
      <MainContent />
      <Flower />
      <FriendshipPage 
      title="Happy Birthday, Alice!"
      subtitle="Celebrating your special day with love"
      welcomeText="Happy Birthday!"
      specialNote="Custom special note here..."
      cardLabels={{
        messages: "Birthday Wishes",
        photos: "Birthday Memories",
        surprises: "Birthday Surprises"
      }}
      showAdminControls={false} // Hide admin controls if needed
    />
    </div>

  );
}

export default App;
